var text = [
  "in the year 200x, a super robot named megaman",
  "was created. dr. light created megaman",
  "to stop the evil desires of dr. wily.",
  "however, after his defeat, dr. wily created eight",
  "of his own robots to counter megaman."
];
var progress=0;
var lastprogress=0;
var movestart=0;
var lastpresstime=0;


function _sound(){
  music(0);
}

function _draw(){
  cls();
  var ctime=time()*1;

  // background
  var bgy=movestart ? (ctime-movestart)*20 : 0;
  var bgh=10*cellheight();
  map(0,0,0,bgy,10,10);

  // building
  var ch = cellheight();
  var n=15;
  var t=movestart?ctime-movestart:0;
  var y=-1000 + 100*t;
  var ytop=150;
  y=min(ytop,y);
  for(var i=0;i<n;i++){
    map(10,0,144,y+5*ch*i,7,5);
  }
  // top
  map(10,5,144,y-3*ch,7,5);
  spr(206,199,y-2*ch-8,2,2);



  // input
  progress=min(text.length,flr(ctime*0.5));
  if(lastprogress!==progress){
    lastpresstime=ctime;
  }
  lastprogress=progress; 
  if(progress>=text.length && !movestart) movestart=ctime;

  // text
  rectfill(0,bgy+bgh,width(),bgy+bgh+75,0);
  var gradient = [1,13,2,0];
  if(!movestart){
    var xt=clamp(3*(ctime-lastpresstime),0,2);
    var x=flr(xt*(gradient.length-1));
    var x2=flr((2-xt)*(gradient.length-1));
    var ctext=text[(progress-1)%text.length];
    var ccolor=gradient[x];
    if(progress && ccolor && ctext){
      print(ctext,20,bgy+bgh+10,ccolor);
    }
    var ntext=text[(progress)%text.length];
    var ncolor=gradient[x2];
    if(ntext && ncolor){
      print(ntext,20,bgy+bgh+10,ncolor);
    }
  }

  // game logo
  if(y===ytop){
    map(18,0,35,30,12,4);
    spr(202,104,93,3,2);
    print("press start",width()/2-2*11,130,1);
  }
}
